Variables represent values as an identifier. They can be changed if they are not constant (see Identifier modifiers ). They do not represent a value as long as they are not definitly initialized. Initializing a variable is done with the assignments = or := . Where the latter is futher explained in Variable declaration . Example: var0 : int32
// var0 can only be used in assignments not anywhere else
var0 = 0
// var0 can be used
io.println(var0)

