Capabilities are for ensuring functionality and casting semantics. expr := expr0 @ caps caps := ids Where an id in ids must one of: Safe : Ensure safety (only safe dynamic allocations must be used). Ensures every operation in the associated expr0 , is safe . This includes constructors AND functions. This : Allow access to private members of semantic expr0 . expr0 has to be a class instance. Const : Only allow constant access to semantic expr0 . Value : Cast to r-value. Unique : Ensure there's no other semantic named the same in the current context (works only with named semantics). Two id s of the same type aren't allowed in caps . Examples: class Person // Private modify function func@Safe,Unique _modify ;
; // Call modify
Person()@This._modify()

