To create a value from a class-type, constructors are used. At default every class, which doesn't have any custom constructors, has a constructor with no parameters. Custom constructors are not-virtual functions, which have the same name as the class or equal to name of the class prefixed with a _ . The latter is a private constructor. To construct a value from a class, a class-type has to be called just like a function. Example: class Person _name : std.String _age : int32 // Below is a constructor func Person(name : std.String, age : int32) ._name = name ._age = age ; func printName std.io.println(._name) ;
; // Create an instant of Person and save it in p0
p0 := Person(std.String("Noone"), -1)

